(402, '20-05-2019 14:20:27', 'Survey dan Penawaran', 'QR190520.01', '12-06-2019', 'IT', 'EGN', 'server dan periperhal', 'Dear Purchasing team,\r\nMenindak lanjuti email saya satu bulan yang lalu karena belum ada respon sampai saat ini,saya isikan juga request saya melalui progam ini dengan harapan segera mendapat respon.\r\n \r\nMohon Didatangkan segera Vendor untuk upgrade Server, upgrade kabeling NOC, upgrade Wireless, Upgrade Antivirus Kaspersky onsite.\r\n\r\nBiar datang dan di survey dulu oleh vendor sehingga terjadi komunikasi antar ITSAI dan Vendor pengenalan kondisi SAI.\r\n\r\nSetelah survey bisa ajukan penawaran/agreement dstrsnya.\r\n\r\nDitunggu ya...\r\n\r\n \r\n\r\nTerimakasih,\r\n\r\n \r\n\r\nBest Regards\r\n\r\n----------------------------------------\r\n\r\nEdwin Gita Nugraha\r\n\r\nInformation Technology\r\n\r\nPT. Surabaya Autocomp Indonesia\r\n\r\nTelp. +62321 6817400 ext.5401\r\n\r\nFax.  +62321 6817541', 0, '', 0, ''),
(403, '23-05-2019 08:21:14', 'Laptop Series Latitude', 'QR190523.01', '29-05-2019', 'IT', 'EGN', 'Terbaik', 'Dear team Purchasing sai\r\nMinta bantu di carikan penawaran untuk item-item berikut sebagai pengganti laptop Mr. Inatomi (Quality) sesegera mungkin.\r\nDengan item sebagai berikut\r\n1. Dell Latitude 3500\r\n2. Dell Latitude 5500\r\n3. Dell Latitude 5590\r\nNote : Dengan spesifikasi Hardisk dan RAM dengan kapasitas sama (512 GB untuk hardisk, serta RAM 16 GB)', 0, 'Compare Laptop.jpg', 0, ''),
